export const UkraineMap = () => {
  const [selectedPart, setSelectedPart] = useState("");

  const handleClick = (e: any) => {
    const district = e.target.id;
    console.log("clicked", district);

    if (selectedPart === district) {
      setSelectedPart("");
      return;
    }

    setSelectedPart(district);
  };
  return (
    <>
      <MapSVG onClick={handleClick} selected={selectedPart} />
    </>
  );
};

